import React, { useState, useEffect } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import {  Routes, useNavigate } from "react-router-dom";
// import "./dashboard.css";
import LogoutButton from "./logout/logout";
import { useAuth } from "./AuthContext";

const AdminDashboard = () => {
  const { token, email } = useAuth();
  const [adminInfo, setAdminInfo] = useState(null);
  const [isAdmin, setIsAdmin] = useState(false); // You need a way to determine if it's an admin
  const [adminEmail, setAdminEmail] = useState(''); // Set the admin's email here
  const [isLoading, setIsLoading] = useState(true);
  const [selectedPhoto, setSelectedPhoto] = useState(null);

  const navigate = useNavigate();

  useEffect(() => {
    const fetchAdminInfo = async () => {
      try {
        if (token && isAdmin) { // Check if it's an admin
          // Fetch admin information based on email
          const response = await fetch(`/data?email=${adminEmail}`, {
            headers: {
              Authorization: `Bearer ${token}`,
            },
          });

          if (response.status === 200) {
            const adminData = await response.json();
            setAdminInfo(adminData);

            setSelectedPhoto(adminData.photo);
         
    setIsLoading(false);
} else {
  console.error('Failed to fetch user information');
}
}
} catch (error) {
console.error('Fetch user info error:', error);
}
};

    if (token) {
      fetchAdminInfo();
    }
  }, [token, isAdmin, adminEmail, navigate]);

  // Example role-based content rendering
  const renderAdminContent = () => {
    if (adminEmail === "sumegha.shretha@deerwalk.edu.np") {
      // Render a form for entering student information
      return <div>Form for entering student information</div>;
    } else if (adminEmail === "sarthak.singh@deerwalk.edu.np") {
      // Render a form for entering student marks
      return <div>Form for entering student marks</div>;
    } else if (adminEmail === "sudin.rajbhandari@deerwalk.edu.np") {
      // Render a form for entering student achievements
      return <div>Form for entering student achievements</div>;
    } else {
      return null; // No specific role-based content
    }
  };

  return (
    <div className="container-fluid">
      <div className="row">
        <nav id="sidebar" className="col-md-3 col-lg-2 d-md-block bg-light sidebar">
          <div className="position-sticky">
            <ul className="nav flex-column">
              {/* Add your admin-specific navigation links here */}
            </ul>
          </div>
        </nav>
  
        {/* Main content */}
        <main className="col-md-9 ms-sm-auto col-lg-10 px-md-4">
          <div className="d-flex justify-content-between flex-wrap flex-md-nowrap align-items-center pt-3 pb-2 mb-3 border-bottom">
            <h1 className="h2">Admin Dashboard</h1>
            <LogoutButton />
          </div>
  
          {isLoading ? (
            <p>Loading user data...</p>
          ) : (
            /* Display user data when it's available */
            <div>
              <div>
                {selectedPhoto !== null ? (
                  <div>
                    <img
                      src={`data:image/jpeg;base64,${selectedPhoto}`}
                      alt="User Photo"
                      style={{ maxWidth: '200px', borderRadius: '50%' }}
                    />
                  </div>
                ) : (
                  <div>
                    {/* You can add an input for changing the photo here if needed */}
                  </div>
                )}
              </div>
              <div className="mt-4">
                <p><strong>Name:</strong> {adminInfo.name}</p>
                <p><strong>Email:</strong> {adminInfo.email}</p>
                <p><strong>Admin Id:</strong> {adminInfo.adminId}</p>
              </div>
            </div>
          )}
  
          <Routes>
            {/* Define your admin-specific routes here */}
          </Routes>
        </main>
      </div>
    </div>
  );
}
